import classes from './ShowSearchedMovie.module.css';

const ShowSearchedMovie = props => {
    return (
        <div >
            <li>
            <p style={{color:"white" , marginLeft:"30px", alignContent:"center" }}>{props.title}</p>
                <p style={{ color: "white", marginLeft: "30px", alignContent: "center" }}>{props.description}</p>
            <img
                style={{ height: "280px", width: "241px" }}
                src={props.image} alt="" />
            
            </li>
        </div >
    );
};

export default ShowSearchedMovie;
